RecipeInstructions:
c("Place ONE cup each sugar, milk, and flour in large glass or plastic bowl.", "Cover lightly with plastic wrap and set on your counter at room temperature. Stir with a wooden spoon everyday for 17 days.", "On day 18 do nothing.", "On days 19, 20, and 21, stir.", "On day 22, add 1 cup sugar, 1 cup milk, and 1 cup flour, and stir again.", "On days 23, 24, 25, and 26 stir.", "On day 27, add 1 cup milk, 1 cup flour, and 1 cup sugar and stir.", "It's now ready to use to make the bread.", "Give away two cups of the starter to two friends, use one to make the bread, and keep one to keep the starter going.  When you give away a cup of the starter, give these directions for keeping it going:  Do not refrigerate; Do not use metal spoon or metal bowl; Do not cover tightly, cover loosely with plastic wrap.", 
"AMISH FRIENDSHIP BREAD:  Mix oil, eggs, and vanilla with the starter mix.", "In a separate bowl, mix flour, sugar, baking powder, cinnamon, salt, baking soda, vanilla pudding mix, and nuts.", "Add to liquid mixture and stir thoroughly.", "Pour into two large well-greased 9x5 inch loaf pans, or one Bundt pan, that have been sprinkled with a mixture of cinnamon, sugar, and flour.", "Sprinkle more cinnamon and sugar on the tops of the unbaked loaves (or cake).  Bake at 325F for one hour or until done."
)

c("Preheat oven to 450 degrees F.", "Combine dry ingredients.", "Cut in shortening with two knives or a pastry  blender until mixture resembles coarse cornmeal.", "Make a well in the centre  and add liquid all at once. Stir vigorously until dough comes freely from  the sides of the bowl.", "Turn dough onto a lightly floured board and roll or  pat to 1/2-inch thick.", "Cut out 2-inch biscuits with a floured water glass  or biscuit cutter.", "Place on an ungreased baking sheet. Bake for 12 to 15  minutes, until tops are golden brown.", 
"Serve immediately with butter, jam or  honey.", "Variations:  Cheese Tea Biscuits  Use only 3/4 tsp salt and 1/4 cup shortening.", "Add 3/4 cup shredded cheese (yellow or marble) to dry ingredients.", "Buttermilk Tea Biscuits  Use only 2 tsp baking powder  Add 1/2 tsp baking soda  Replace milk with 1 cup   buttermilk or sour milk.", "Raisin or Nut Tea Biscuits  Add to dry ingredients  1/4 cup sugar; and  3/4 cup seedless raisins or chopped nuts  Use only 7/8 cup milk  Whole Wheat Tea Biscuits  Replace 1 cup of white flour with 1 cup whole wheat flour."
)

c("Measure carefully, placing all ingredients except cornmeal in bread machine pan in order specified by owner manual.", "Program dough cycle setting; Press start.", "When dough is finished, remove dough from bread machine and let it rest 2 - 3 minutes.", "Pat and gently stretch dough from edges until dough seems to not stretch anymore.  Let rest 2-3 minutes more.  Continue patting and stretching until dough is 12 - 14 inches in diameter.", "Spray 12-14 inch pizza pan with cooking spray; Sprinkle with cornmeal, if desired.", 
"Press dough into pan; Cover with towel and let stand in warm place for about 10 minutes  ***  I have added toppings with the dough from here and baked and it's great! But the recipe continues on -- ***", "Position oven rack in lowest position; Preheat oven at 500°F Prick crust with fork at 2 inch intervals, Bake 4 - 5 minutes or until top is dry but not yet golden.", "Remove from oven.", "Follow topping and baking directions for individual recipes.", "Makes 1 thick 12-inch crust or 1 medium-thick 14 inch crust. *** I've also been known to add garlic to this recipe.*** Enjoy!"
)
